    n=int(input())
    mod=10000000000007
    count=0
    def gcd(x,y):
        while y:
            x,y=y,x%y
        return x
    def f(p):
        f_p=set()
        for i in range(len(p)):
            gcd_i=p[i]
            for j in range(i+1,len(p)):
                gcd_i=gcd(gcd_i,p[j])
            f_p.add(gcd_i)
        return len(f_p)
    def dfs(n,perm,depth,count,max_f):
        if depth==n:
            if f(perm)==max_f:
                nonlocal count
                count+=1
        else:
            for i in range(n):
                if i not in perm:
                    perm.append(i)
                    dfs(n,perm,depth+1,count,max_f)
                    perm.pop()
    max_f=1
    for i in range(1,n+1):
        max_f=max(max_f,i)
    for i in range(1,n+1):
        dfs(n,[],0,max_f)
    return count%mod

