def solution(input_string):
    h,n=list(map(int,input().split()))
    if h==0:
        return 0
    def dfs(root,level,index):
        if index==n:
            return 1
        count=0
        if index*2**(h-level)>2**h:
            return count
        count+=dfs(root*2,level+1,index*2)
        count+=dfs(root*2+1,level+1,index*2+1)
        return count
    return dfs(1,1,1)

