    for i in range(1, N):
        for len_s in range(max_len):
            for len_p in range(len_s, max_len):
                for k in range(len_s, len_p+1):
                    if strings[i][0][k] == strings[0][0][i]:
                        if dp[i][k] > dp[i-1][k-1] + strings[i][1]:
                            dp[i][k] = dp[i-1][k-1] + strings[i][1]
    min_cost = float('inf')
    for i in range(max_len):
        for j in range(i, max_len):
            if dp[N-1][i] <= dp[N-1][j]:
                min_cost = min(min_cost, dp[N-1][i])
