def solution(input_string):
    n, k = list(map(int, input().split(' ')))
    factors = set(range(1, int(n**0.5) + 1))
    def is_prime(x):
        if x < 2:
            return False
        for i in range(2, int(x**0.5) + 1):
            if x % i == 0:
                return False
        return True
    for i in range(2, int(n**0.5) + 1):
        if is_prime(i) and n % i == 0:
            factors.add(i)
            factors.add(n//i)
    factors.add(n)
    factors = list(factors)
    dp = [0] * (k+1)
    dp[0] = 1
    for i in range(1, k+1):
        for j in factors:
            if j <= i:
                dp[i] = (dp[i-1] + dp[i-j]) % (10**9 + 7)
    return dp[-1]

