def solution(input_string):
    f = lambda: map(int, input().split())
    n, x = f()
    vouchers = []
    for i in range(n):
        l, r, cost = f()
        vouchers.append((l, r, cost))
    vouchers.sort(key=lambda x: x[0])
    left = 0
    right = x
    minimum_cost = float('inf')
    for l, r, cost in vouchers:
        if l >= right:
            continue
        if l < left:
            left = l
        else:
            minimum_cost = min(minimum_cost, cost)
        if r >= left + x:
            right = r
        else:
            left = r + 1
    return minimum_cost if right - left + 1 == x else -1

