def solution(input_string):
    n=int(input())
    arr=list(map(int,input().split()))
    i=1
    while n>1:
        if arr.count(max(arr))>1:
            arr.remove(max(arr))
        else:
            i=(i+1)%n
            arr.remove(arr[i-1])
            arr.remove(arr[i])
            arr.append(sum(arr[i-1:i+1]))
            arr.pop(i-1)
            n-=1
        if i==1:
            i=0
    return max(arr[0],arr[-1])

