def solution(input_string):
    read = lambda: map(int, input().split())
    n, S = read()
    a = list(read())
    cost = [0] * (n+1)
    for i in range(1, n+1):
        cost[i] = a[i-1] + i * S

    result = []
    for k in range(1, n+1):
        for subset in combinations(range(1, n+1), k):
            subset_cost = sum(cost[i] for i in subset)
            if subset_cost <= S:
                result.append(subset_cost)
    if not result:
        return 0, 0
    return k, min(result)

