    else:
        actions=[]
        if k*(n-1)>(max_height-min_height):
            actions.append(max_height-min_height+k*(n-1)
        else:
            actions.append(k*(n-1))
        for i in range(1,n):
            if a[i]>max_height:
                actions.append(a[i]-max_height-k)
            elif a[i]<min_height:
                actions.append(min_height-a[i]-k)
            else:
                actions.append(k)
        if sum(actions)<0:
            actions.sort(reverse=True)
        for i in range(n):
            if a[i]+actions[i]%k==0:
                a[i]+=actions[i]
            else:
                a[i]+=actions[i]-actions[i]%k
        return actions

