def min_shots(coordinates,x,y):
    max_x=0
    max_y=0
    for i in range(len(coordinates)):
        max_x=max(max_x,coordinates[i][0])
        max_y=max(max_y,coordinates[i][1])
    shots_x=0
    shots_y=0
    for i in range(1,max_x+1):
        if (x+i,y) in coordinates or (x-i,y) in coordinates:
            shots_x=i
            break
    for i in range(1,max_y+1):
        if (x,y+i) in coordinates or (x,y-i) in coordinates:
            shots_y=i
            break
    return min(shots_x, shots_y)

