    n, k = map(int, input().split())
    # prepare sets
    sets = [set() for _ in range(k)]
    # loop through all possible numbers from 1 to n
    for num in range(1, n+1):
        # get the keeper with the least amount of words
        current_keeper = min(range(k), key=lambda i: len(sets[i]))
        # add the number to the current keeper's set
        sets[current_keeper].add(num)
        # check if the secret is safe
        for i in range(k):
            for j in range(i+1, k):
                if not sets[i].isdisjoint(sets[j]):
                    return [-1]
        # check if the current number is part of an arithmetic progression
        for i in range(1, k):
            if (num - 1) in sets[i] and (num - 2) in sets[i]:
                return [-1]
    # loop through all the sets and print the result
    result = [0] * n
    for i, set_ in enumerate(sets):
        for num in set_:
            result[num-1] = i+1
    return result

