    for _ in range(n):
        freight_trains.append(list(map(int, input().split()))

    # Implement your algorithm here
    # You can use the following function to check if a time is inside the boarding window
    def boarding_window(time):
        return time % 30 == 0 or time % 30 == k

    # Implement your algorithm here
    # Return True if it is safe to board the tram at time
    def safe_boarding(time):
        for train in freight_trains:
            if train[0] * 60 + train[1] > time:
                return False
        return True

    # Initialize the result
    min_canceled = n
    min_t = 0
    # Iterate through all possible values of t
    for t in range(k):
        safe_trains = []
        for train in freight_trains:
            if boarding_window(train[0] * 60 + train[1] - t) or safe_boarding(train[0] * 60 + train[1] - t):
                safe_trains.append(train)
        if len(safe_trains) < min_canceled:
            min_canceled = len(safe_trains)
            min_t = t

    return min_canceled, min_t

