        graph[u].append((v,c))
        graph[v].append((u,c)
    # initialize the distnace dictionary
    dist = {i:float('inf') for i in range(n)}
    dist[0] = 0
    # BFS
    queue = [(0,0)]
    while queue:
        node, d = queue.pop(0)
        for neighbor, cost in graph[node]:
