def solution(input_string):
    MOD = 10**9 + 7
    memo = {}
    def factorize(x, y):
        if x == 1:
            return [1]
        if x in memo:
            return memo[x]
        memo[x] = []
        for i in range(2, x+1):
            if x % i == 0:
                if y == 1:
                    memo[x] = [i]
                elif y > 1:
                    memo[x] = [i] + factorize(x//i, y-1)
                elif y == 2:
                    memo[x] = [i, x//i]
        return memo[x]
    q = int(input())
    for i in range(q):
        x, y = map(int, input().split())
        memo = {}
        count = 1
        for i in range(y):
            count *= len(factorize(x, i))
        for i in range(y):
            count *= len(factorize(x*y, i))
        print(count % MOD)
