def solution(input_string):

    def is_array(element):
        return element.startswith('{') and element.endswith('}')

    def is_value(element):
        return not is_array(element) and element.strip() not in ['{', '}']

    def is_start_array(element):
        return element == '{'

    def is_end_array(element):
        return element == '}'

    def process_element(element, indent):
        if is_array(element):
            return element.strip()
        elif is_value(element):
            return f'{" " * indent}{element.strip()},\n'
        elif is_start_array(element):
            return f'{" " * indent}{element}\n'
        elif is_end_array(element):
            return f'{" " * (indent - 2)}{element}\n'

    lines = input_string.split(',')
    indent = 2
    result = ''
    for i, element in enumerate(lines):
        result += process_element(element, indent)
        if is_start_array(element):
            indent += 2
        elif is_end_array(element):
            indent -= 2
    return result.strip()[:-2] # remove last comma and new line character

