def solution(input_string):

    n, k = map(int, input_string.split())
    jewels = []
    for _ in range(n):
        size, value = map(int, input().split())
        jewels.append((size, value))

    # Initialize dp array
    dp = [[0 for _ in range(k+1)] for _ in range(n+1)]

    for size, value in jewels:
        for i in range(1, k+1):
            if size <= i:
                dp[i][size-1] = max(dp[i][size-1], dp[i-size][size-1]+value)
            for j in range(size, k+1):
                dp[j][i] = max(dp[j][i-1], dp[j-size][i-1]+value)

    # Reverse the dp array
    result = []
    for i in range(k, 0, -1):
        result.append(dp[i][n-1])

    return ' '.join(map(str, result))

