def solution(input_string):

    Z, F = map(int, input_string.split())
    forbidden_dates = []

    for _ in range(F):
        forbidden_dates.append(list(map(int, input().split()))

    # Generate all dates between October 1, 2018 and October 31, 2019
    all_dates = [(y, 10, d) for y in range(2018, 2020) for d in range(1, 32)]

    # Remove forbidden dates from the list
    for year, month, day in forbidden_dates:
        all_dates.remove((year, month, day))

    # Sort the remaining dates in chronological order
    all_dates.sort()

    # Implement the penalty function
    def penalty(date):
        year, month, day = date
        if month == 10 and day == 01 and year == 2018:
            return 0
        elif month == 10 and day == 01 and year == 2019:
            return 32**2
        else:
            return abs(date[0] - 2018)**2

    # Iterate over all possible schedules
    min_penalty = float('inf')
    min_schedule = None
    for schedule in itertools.permutations(all_dates):
        schedule_penalty = sum(penalty(date) for date in schedule)
        if schedule_penalty < min_penalty:
            min_penalty = schedule_penalty
            min_schedule = schedule

    return min_penalty, *min_schedule

