def solution(input_string):
    n, m = input().split()
    n, m = int(n), int(m)
    matrix = []
    for i in range(n):
        matrix.append(list(input()))
    def dfs(x, y, state):
        if matrix[x][y] == str(state):
            return 0
        if matrix[x][y] == '.':
            matrix[x][y] = state
            return 1
        if matrix[x][y] != str(state) or matrix[x][y] == '#':
            return float('inf')
        if x > 0:
            return dfs(x-1, y, state) + 1
        if x < n-1:
            return dfs(x+1, y, state) + 1
        if y > 0:
            return dfs(x, y-1, state) + 1
        if y < m-1:
            return dfs(x, y+1, state) + 1
    min_cost = float('inf')
    for i in range(n):
        for j in range(m):
            if matrix[i][j].isdigit():
                min_cost = min(min_cost, dfs(i, j, matrix[i][j]))
    return min_cost if min_cost != float('inf') else -1

