def solution(input_string):
    n = int(input())
    colors = list(map(int, input().split()))
    edges = [list(map(int, input().split())) for _ in range(n-1)]
    adj_list = [[] for _ in range(n)]
    for edge in edges:
        u, v = edge
        adj_list[u-1].append(v-1)
        adj_list[v-1].append(u-1)
    def dfs(v, parent):
        stack = [(v, None)]
        white_count = colors[v]
        black_count = 1 - colors[v]
        max_diff = 0
        while stack:
            node, parent_color = stack.pop()
            for child in adj_list[node]:
                if child != parent:
                    if colors[child] == parent_color:
                        stack.append((child, parent_color))
                        continue
                    if parent_color == None:
                        stack.append((child, colors[child]))
                    else:
                        stack.append((child, 1 - parent_color))
                    if parent_color:
                        white_count += 1
                        black_count -= 1
                    else:
                        white_count -= 1
                        black_count += 1
                    max_diff = max(max_diff, white_count - black_count)
        return max_diff
    res = []
    for i in range(n):
        if colors[i]:
            res.append(dfs(i, colors[i]))
        else:
            res.append(-1)
    return res

